import { toJS } from 'mobx';
import { exampleFilm } from '../../../../../../example-data/browsing/film';
import { browsingStoreInstance } from '../../browsing-store';
import { getFilmById } from '../get-film-by-id';
describe('getFilmById', function () {
    beforeAll(function () {
        browsingStoreInstance.actions.addFilms([exampleFilm]);
    });
    it('can get a film by id', function () {
        var film = getFilmById(exampleFilm.id);
        expect(toJS(film)).toEqual(exampleFilm);
    });
    it('returns undefined if the film isn\'t present', function () {
        var film = getFilmById('UNKNOWN');
        expect(film).toBeUndefined();
    });
});
